          stroke="#d3a9bd"
          stroke-miterlimit="10"
          stroke-width="0.5"
        />
        <path
          id="wing01"
          d="M198.69,341.07l2.85-5.83,1.13-2.29c.77-1.59,1.55-3.19,2.31-4.79,2.51-5.32,4.87-10.91,9.09-15,1.14-1.1,2.78-2.13,4.18-1.47a3.48,3.48,0,0,1,1.56,1.76c2,4.18.59,9.17-1.15,13.49a27.13,27.13,0,0,1-3.32,6.36c-3.75,5-10.08,7.31-14.47,11.74-.8.82-3.92,4.34-5,2.53C195.25,346.51,198.14,342.2,198.69,341.07Z"
          fill="#bca5af"
          stroke="#d3a9bd"
          stroke-miterlimit="10"
          stroke-width="0.5"
        />
      </g>
    </g>
  </svg>
</template>

<script setup>
  import { gsap } from 'gsap'
  import { MotionPathPlugin } from 'gsap/MotionPathPlugin.js'
  import { onBeforeMount, onBeforeUnmount, onMounted, ref } from 'vue'

  gsap.registerPlugin(MotionPathPlugin)

  const tl1 = gsap.timeline({ repeat: -1, repeatDelay: 3, paused: false })
  const tl = gsap.timeline({ delay: 2, repeat: -1, repeatDelay: 3, paused: true })

  function wingMotion() {
    const wings = gsap.utils.toArray(['#wing01', '#wing02', '#wing03', '#wing04'])
    tl1.set(wings, { transformOrigin: '-5% 100%', rotate: 0, scaleX: 1 })
    tl1.to([wings[0], wings[3]], {
      stagger: 0.15,
      scaleX: 0.6,
      rotate: -10,
      duration: 0.3,
      ease: 'bounce.in',
      yoyo: true,
      repeat: 5,
    })
    tl1.to(
      [wings[1], wings[2]],
      {
        stagger: 0.2,
        scaleX: 0.8,
        rotate: 13,
        ease: 'bounce.out',
        duration: 0.4,
        yoyo: true,
        repeat: 4,
      },
      '<'
    )
    tl1.to(wings, {
      stagger: 0.2,
      rotate: 0,
      scaleX: 1,
    })
  }
  function frogJump02() {
    tl.removePause()
    tl.play()
  }
  function frogJump01() {
    tl.add('l1', 0).add('l2', 0.1)
    tl.add('l3', 1.2).add('l4', 1.3).add('l5', 2.2)

    tl.to(
      '#frog',
      {
        motionPath: {
          path: [
            { x: 300, y: -220 },
            { x: 0, y: 0 },
          ],
        },
        ease: 'sine.in',
        duration: 0.9,
      },
      'l1'
    ).addPause(1.2)

    tl.to(
      '#frog',
      {
        rotation: -20,
        yoyo: true,
        repeat: 1,
        duration: 0.5,
        ease: '"slow(0.1, 0.4, false)"',
      },
      'l1'
    )
    tl.to('#frontLeg', { rotation: 40, repeat: 1, yoyo: true }, 'l2')
    tl.to('#backLeg', { rotation: -150, repeat: 1, yoyo: true }, 'l2')
    tl.to('#backLowerLeg', { rotation: 180, repeat: 1, yoyo: true }, 'l2')
    tl.to('#foot', { rotation: -170, repeat: 1, yoyo: true }, 'l2')
    // Second part of the jump
    tl.to(
      '#frog',
      {
        motionPath: {
          path: '#jump-path',
          align: '#jump-path',
          alignOrigin: [0.5, 0.7],
          start: 1,
          end: 0,
        },
        duration: 1,
      },
      'l3'
    )

    tl.to(
      '#frog',
      {
        rotation: -40,
        yoyo: true,
        repeat: 1,
        duration: 0.9,
        ease: 'back.inOut',
      },
      'l3'
    )
    tl.to('#frontLeg', { rotation: 40 }, 'l4')
    tl.to('#backLeg', { rotation: -150 }, 'l4')
    tl.to('#backLowerLeg', { rotation: 180 }, 'l4')
    tl.to('#foot', { rotation: -180 }, 'l4')

    tl.to(
      ['#splash01', '#splash02', '#splash03'],
      { scale: 1.1, opacity: 0, stagger: 0.6, duration: 4, ease: 'power1.out' },
      'l5'
    )
  }

  onMounted(() => {
    gsap.set(['#splash01', '#splash02', '#splash03'], {
      scale: 0,
      transformOrigin: '50% 50%',
    })

    gsap.set('#frog', { x: 300, y: -220 })

    gsap.set('#body-group', { transformOrigin: '50% 59%', rotation: -0 })
    gsap.set('#frontLeg', { transformOrigin: '75% 10%', rotation: -0 })
    gsap.set('#backLeg', { transformOrigin: '75% 30%', rotation: -0 })
    gsap.set('#backLowerLeg', { transformOrigin: '25% 30%', rotation: -0 })
    gsap.set('#foot', { transformOrigin: '85% 20%', rotation: -0 })
    gsap.set('#footFront', { transformOrigin: '85% 30%', rotation: -0 })

    wingMotion()
    frogJump01()

    tl.play()
  })

  onBeforeUnmount(() => {
    tl.revert()
    tl1.revert()
  })
</script>
